import React, { useState } from "react";
import { Route } from "react-router-dom";
import Posts from "./posts";
import Register from "./register";

const App = () => {
    const [posts, setPosts] = useState([]);
    const [token, setToken] = useState("");

    return (
        <main>
            <Route exact path = "/">
                <div>starngers things</div>
            </Route>
            <Route path = "/posts">
                <Posts/>
            </Route>
            <Route path = "/login">
                <Login/>
            </Route>
            <Route path = "/featured">
                <Register/>
            </Route>
            <Route path = "/profile">
                <Logout/>
            </Route>
            <Route path = "/home">
                <Home/>
            </Route>
        </main>
    );
};
export default App;
